import React from "react";

import * as Styled from "./style";
import Tr from "../Tr";
import Th from "../Th";

const Table = ({ headData, bodyData }) => {
  let renderTableHeadData = () =>
    headData.map((data) => {
      console.log(data);
      <Th>{data}</Th>;
    });

  return (
    <Styled.Table>
      <thead>
        <Tr>{renderTableHeadData()}</Tr>
      </thead>
      <tbody></tbody>
    </Styled.Table>
  );
};

export default Table;
